import React from "react";

function template() {
  return (
    <div className="Home">
      <div id="fondo" className="w-100">
        <div className="container position-relative filtrado p-4" style={{background: "white"}}>
          <form action="">
            <input type="text" />
            <input type="text" />
            <input type="text" />
            <input type="text" />
